import React from "react";
import badge from "./badge.svg";
import styled from "styled-components";

const Complete = (props) => {
  const Image = styled.img`
    max-width: 80vw;
    align-self: center;
    justify-self: center;
  `;

  return (
    <>
      <Image src={badge} />
    </>
  );
};

export default Complete;
